export default function CookiesList() {
    const cookies = [
        { label: 'Strawberry Cookie', value: 'strawberry' },
        'Strawberry Cookie',
        'Gingerbrave',
        'Muscle Cookie',
        'Wizard Cookie',
        'Beet Cookie',
        'Angel Cookie'
    ]

    return cookies;
}
